                <img src="https://images.unsplash.com/photo-1480487453552-4d3c7d1d65e1?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60" 
                alt="_blank"/>
            </div>
            <div className="card-content">
                <h6>title</h6>
                <p>this is amazing post</p>
                <input type="text" placeholder="add a comment"/>
